import Rebase from 're-base';
import firebase from 'firebase';

const firebaseApp = firebase.initializeApp({
  apiKey: "AIzaSyBh7a6-vtPlW7z0Af3cR-kwUdyUqxisUSk",
  authDomain: "catch-of-the-day--zerbini.firebaseapp.com",
  databaseURL: "https://catch-of-the-day--zerbini-default-rtdb.europe-west1.firebasedatabase.app",
});

const base = Rebase.createClass(firebaseApp.database());

// this is a named export
export {firebaseApp} ;

// this is a default export
export default base;
